import Foundation

class LoadRemoteUrlPresetDataUseCase {
    let remoteUrlPresetRepository: RemoteUrlPresetRepository

    init(remoteUrlPresetRepository: RemoteUrlPresetRepository) {
        self.remoteUrlPresetRepository = remoteUrlPresetRepository
    }

    func call() -> [URL] {
        return remoteUrlPresetRepository.getPresetData()
    }

    func add(url: URL) {
        return remoteUrlPresetRepository.addPresetData(url: url)
    }

    func save(remoteUrlPresetData: [URL]) {
        return remoteUrlPresetRepository.savePresetData(remoteUrlPresetData: remoteUrlPresetData)
    }
}
